import DropList from '../common-components/DropList';
import styles from './settingsdroplist.module.css';
import { IoSettingsOutline , IoSettingsSharp } from 'react-icons/io5';
import Items from '../common-components/Items'

function SettingsDropList(){
    return(
        <div>
        <li className={styles.settings_settings}><Items className={styles.settings_icon} iconA={<IoSettingsOutline className="icon"/>} iconB={<IoSettingsSharp/>} title="Settings"/></li>
        <DropList className={styles.settings_droplist}>
            <li className={styles.settings_divider}></li>
            <li className={styles.settings_item}>Keyboard shortcuts</li>
            <li className={styles.settings_item}>About</li>
            <li className={styles.settings_item}>Download the desktop app</li>
            <li className={styles.settings_item}>Download the mobile app</li>
        </DropList>
        </div>

    )
}

export default SettingsDropList;
